  false,\n\t\"url\": null,\n\t\"notes\": \"The Crab Orchard National Wildlife Refuge
  Fishery Management Plan states the broad goals for fish management and outlines
  on a lake by lake basis the steps necessary to acheive these goals. Responsibilites
  of the Refuge for fishery mangement include furnishing personnel, materials, services
  and facilities necessary to achieve fish management goals. TheRefuge will assist
  by providing consultation, assistance in fish collections, fishery surveys, law
  enforcement, and as available fish for stocking Refuge waters from its State Fish
  Hatchery System.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
